import Login from "./pages/login/Login"
import Register from "./pages/register/Register";
import {
  createBrowserRouter,
  RouterProvider,
  Route,
} from "react-router-dom"
function App() {

  const router = createBrowserRouter([
    {
      path: "/login",
      element: <Login/>
    },
    {
      path: "/register",
      element: <Login/>
    },
  ])

  return <div>
    <RouterProvider router={router}/>
  </div>;
}

export default App;
